import {getFormatedDateNow} from './milliSecondsToDate';

import {graphicResults} from '../services/interruptions_services/getstatistics-summary-service';
import {graphicResults2} from '../services/interruptions_services/getstatistics-summary-service';
import {graphicResults3} from '../services/interruptions_services/getstatistics-summary-service';

function createChartsColumns(){
  return {
    chart1: {
      chartColumns: [
        {title: "COMUNA", dataKey: "COMUNA"},
        {title: "DOM", dataKey: "DOM"},
        {title: "RED", dataKey: "RED"},
        {title: "TOTAL", dataKey: "TOTAL"}
      ],
      chartData: []
    },
    chart2: {
      chartColumns: [
        {title: 'OFICINA', dataKey:"COMUNA"},
        {title:'CANTIDAD CLIENTES', dataKey:"CANTIDAD CLIENTES"}
      ],
      chartData: []
    },
    chart3: {
      chartColumns: [
        {title: 'COMUNA', dataKey:"COMUNA"},
        {title: 'PORCENTAJE CLIENTES', dataKey: "PORCENTAJE CLIENTES"}
      ],
      chartData: []
    },
    chartTotal: {
      chartColumns: [
        {title: "TOTAL COMUNAS", dataKey: "TOTAL COMUNAS"},
        {title: "TOTAL DOM", dataKey: "TOTAL DOM"},
        {title: "TOTAL RED", dataKey: "TOTAL RED"},
        {title: "CANT. CLIENTES", dataKey: "CANT. CLIENTES"}
      ],
      chartData: []
    },
  };
}

function createChartsTitles(){
  return {
    chart1: "Interrupciones de clientes por comuna",
    chart2: "Interrupciones de clientes por oficina",
    chart3: "Porcentaje de interrupciones de clientes por comuna",
    chartTotal: "Tabla resÃºmen de interrupciones"
  };

}

//TODO: This export all the results for the 3 graphics in pdf.
function exportGraphicsToPDF(){
  //Factories for chart titles and chart data content
  var chartTitles = createChartsTitles();
  var charts = createChartsColumns();

  /* Getting the info from the graphics */

  //FIRST TABLE: CHART 1
  var results = graphicResults.getResultsGraphic();
  charts.chart1.chartData = results[0].map((comuna,index) =>{
    let d = {
      COMUNA: comuna,
      "DOM": results[1][index],
      "RED": results[2][index],
      "TOTAL": results[1][index] + results[2][index]
      };
    return d;
  });

  //SUMMARY TABLE (TOTAL)
  let dom = (charts.chart1.chartData.map((t) =>{return t.DOM})).reduce((acumulado, siguiente) => {
    return acumulado + siguiente;
  }, 0);

  let red = (charts.chart1.chartData.map((t) =>{return t.RED})).reduce((acumulado, siguiente) => {
    return acumulado + siguiente;
  }, 0);

  let cantClie = (charts.chart1.chartData.map((t) =>{return t.TOTAL})).reduce((acumulado, siguiente) => {
    return acumulado + siguiente;
  }, 0);
  charts.chartTotal.chartData = [{
      "TOTAL COMUNAS": charts.chart1.chartData.length,
      "TOTAL DOM": dom,
      "TOTAL RED": red,
      "CANT. CLIENTES": cantClie
    }];

  //SECOND TABLE: CHART 2
  results = graphicResults2.getResultsGraphic2();
  charts.chart2.chartData = results[0].map((comuna,index) =>{
    let d = {
      COMUNA: comuna,
      "CANTIDAD CLIENTES": results[1][index]
      };
    return d;
  });

  //THIRD TABLE: CHART 3
  results = graphicResults3.getResultsGraphic3();
  charts.chart3.chartData = results[0].map((comuna,index) =>{
    let d = {
      COMUNA: comuna,
      "PORCENTAJE CLIENTES": results[1][index]
    };
    return d;
  });

  // Image transformed into dataImage
  let dataUrlImage = "data:image/png;base64,";

  //Setting up the pdf page
  var doc = new jsPDF('portrait', 'pt');
  doc.text("Reporte EstadÃ­sticas Interrupciones", 10, 30);
  doc.addImage(dataUrlImage,"PNG",480, 20, 65, 65);
  doc.text("Fecha:" + getFormatedDateNow() , 10, 55);

  //summary table title
  doc.text(chartTitles.chartTotal, 10, 90);
  //Summary table content
  doc.autoTable(charts.chartTotal.chartColumns,charts.chartTotal.chartData,{
      startY: 100,
      margin: {horizontal: 10},
      styles: {overflow: 'linebreak'},
      columnStyles: {text: {columnWidth: 250}}
  });

  //table title for chart 1
  doc.text(chartTitles.chart1, 10, doc.autoTableEndPosY() + 30);
  //table content for chart 1
  doc.autoTable(charts.chart1.chartColumns,charts.chart1.chartData,{
      startY: doc.autoTableEndPosY() + 45,
      margin: {horizontal: 10},
      styles: {overflow: 'linebreak'},
      columnStyles: {text: {columnWidth: 250}}
  });

  //table title for chart 2
  doc.text(chartTitles.chart2, 10, doc.autoTableEndPosY() + 30);
  //table content for chart 2
  doc.autoTable(charts.chart2.chartColumns, charts.chart2.chartData, {
      startY: doc.autoTableEndPosY() + 45,
      margin: {horizontal: 10},
      styles: {overflow: 'linebreak'},
      columnStyles: {'CANTIDAD CLIENTES': {columnWidth: 160}}
  });

  //table title for chart 3
  doc.text(chartTitles.chart3, 10, doc.autoTableEndPosY() + 30);
  //table content for chart 3
  doc.autoTable(charts.chart3.chartColumns, charts.chart3.chartData, {
      startY: doc.autoTableEndPosY() + 45,
      margin: {horizontal: 10},
      styles: {overflow: 'linebreak'},
      columnStyles: {'PORCENTAJE CLIENTES': {columnWidth: 160}}
  });

  doc.save("Reporte_Interrupciones.pdf");
}

export default exportGraphicsToPDF;
